import{_ as e,a,o as t,H as o}from"./chunks/framework.Cao6T-Ti.js";const k=JSON.parse('{"title":"Keep work","description":"Школа деревообработки","frontmatter":{"title":"Keep work","description":"Школа деревообработки","date":"2016-11-07","icon":"keepwork.png","cover":"photo.jpg","city":"г. Москва","address":"Электролитный проезд, д.3, стр.2.","place":"м. Нагорная","tel":"+ 7 (968) 069-82-18","url":"https://keepwork.pro/school","email":"my@keepwork.pro","coord":[55.67538317566349,37.61742084513356],"status":"open","hours":"Групповые занятия по столярным курсам вторник - четверг с 18:30 до 21:30. \\nИндивидуальные занятия обсуждаются отдельно.\\n","youtube":"https://youtu.be/b_l4lYINDoY"},"headers":[],"relativePath":"workshop/catalog/keep-work/index.md","filePath":"workshop/catalog/keep-work/index.md"}'),r={name:"workshop/catalog/keep-work/index.md"},p=o('<p>Учебно-производственная мастерская «Калпа Врикша» предлагает аренду рабочих мест для любителей и профессионалов столярного дела. Название переводиться с санскрита, как «Дерево желаний», наша специализация это все что связанно с уникальным материалом – деревом, подаренным нам самой природой. Мы объединяем в себе столярную мастерскую (изготовление любой мебели на заказ), учебный центр и магазины, в которых можно купить любые инструменты связанные с деревообработкой. Площади нашей мастерской более 500 м2.</p><p>Так же предлагаем Вашему вниманию покрасочную и сушильную камеру.</p><p>Действует школа столярного мастерства.</p><p>Мы предлагаем - индивидуальные рабочие места (верстаки), шкафчики, места для хранения заготовок, консультации и советы мастеров.</p><p><strong>Мы ждем Вас, теплая и уютная атмосфера, высококлассное оборудование, грамотные специалисты.</strong></p><p><em>Внимание! Для входа на территорию необходим документ удостоверяющий личность.</em></p><h1 id="перечень-оборудования" tabindex="-1">Перечень оборудования <a class="header-anchor" href="#перечень-оборудования" aria-label="Permalink to &quot;Перечень оборудования&quot;">​</a></h1><p><strong>Мастерская оснащена:</strong> **Фрезерные станки: ** Jet JWS-35X Фрезерные столы – 3шт., в том числе с упором и позиционером Incra.</p><p><strong>Ленточные станки:</strong> JET JWBS-20Q JET JWBS-16XT JET JWBS-14DXPRO</p><p><strong>Сверлильные станки:</strong> Jet JDR-34F Jet JDR-34 JET JDP-15T, 380В</p><p><strong>Торцовочная пила:</strong> Festool KAPEX KS 120</p><p><strong>Шлифовальные станки:</strong> JET JOVS-10 JET 22-44 Plus JET JDS-12</p><p><strong>Фуганки и рейсмусы:</strong> JET JPT-310HH, ножи helical, 380В, 307мм JET JWP-209HH с валом &quot;helical&quot;, 380В, 500мм Jet 60A-HH с валом «helical» JET PJ1696 c валом helical, 380В, 400мм</p><p><strong>Циркулярные станки:</strong> Powermatic PM1000, 380Вт Jet JTAS-10DX JET JPS-10TS, 380В</p><p><strong>Токарные станки:</strong> JET JPS-10TS, 380В Jet JWL-1221VS Jet JML-1014i, 230В, 350х250мм Jet JWL-1442, 230В, 1065х355мм Jet JWL-1443 Jet JWL-1642, 230В, 1090х405мм</p><p>Вакуумная система Mark10 с полиуретановым мешком размерами 137х277см. Так же предлагаем Вашему вниманию покрасочную и сушильную камеру.</p><h2 id="групповые-и-индивидуальные-занятия" tabindex="-1">Групповые и индивидуальные занятия <a class="header-anchor" href="#групповые-и-индивидуальные-занятия" aria-label="Permalink to &quot;Групповые и индивидуальные занятия&quot;">​</a></h2><h3 id="занятие-от-1000-рублеи" tabindex="-1">Занятие от 1000 рублей <a class="header-anchor" href="#занятие-от-1000-рублеи" aria-label="Permalink to &quot;Занятие от 1000 рублей&quot;">​</a></h3><p>Стоимость одного группового занятия, при оплате 20-ти занятий единовременно.</p><h3 id="персональныи-график" tabindex="-1">Персональный график <a class="header-anchor" href="#персональныи-график" aria-label="Permalink to &quot;Персональный график&quot;">​</a></h3><p>Занимаетесь в любые удобные для вас дни, когда проходят занятия.</p><h3 id="в-будни-и-выходные" tabindex="-1">В будни и выходные <a class="header-anchor" href="#в-будни-и-выходные" aria-label="Permalink to &quot;В будни и выходные&quot;">​</a></h3><p>Пожалуйста, обратите внимание, что занятия в выходные оплачиваются по отдельным тарифам.</p><h3 id="инструмент-бесплатно" tabindex="-1">Инструмент бесплатно <a class="header-anchor" href="#инструмент-бесплатно" aria-label="Permalink to &quot;Инструмент бесплатно&quot;">​</a></h3><p>Мы предоставляем инструмент бесплатно (редкие исключения указаны в описании курсов). Вам остается только оплатить материалы и расходку.</p><h3 id="единыи-абонемент" tabindex="-1">Единый абонемент <a class="header-anchor" href="#единыи-абонемент" aria-label="Permalink to &quot;Единый абонемент&quot;">​</a></h3><p>Оплаченные вечерние групповые занятия можно распределить между курсами. Например, вы заплатили за 20 занятий и посетили 14 занятий по столярному курсу, а оставшиеся занятия можно использовать на посещение токарного курса.</p><h3 id="несгораемые-занятия" tabindex="-1">Несгораемые занятия <a class="header-anchor" href="#несгораемые-занятия" aria-label="Permalink to &quot;Несгораемые занятия&quot;">​</a></h3><p>Вы можете сделать перерыв в посещении занятий. Например, если вы уехали в отпуск или же у вас загрузка на работе. Все неиспользованные занятия за вами сохраняются. Возврат денежных средств за неиспользованные занятия не производится.</p>',29),n=[p];function s(l,i,h,c,d,J){return t(),a("div",null,n)}const _=e(r,[["render",s]]);export{k as __pageData,_ as default};
